A pochi passi della prossima MM4 fermata Washington/Foppa - In strepitosa palazzina epoca anni '30 proponiamo appartamento ultimo piano con ascensore al piano; 
ingresso ampio soggiorno, cucina separata con ripostiglio, camera con balcone, camera matrimoniale con ampia cabina armadio, bagno finestrato, doppia esposizione, ristrutturato, 
aria condizionata, Cantina. Libero Novembre 2022. Da vedere.
